import React from 'react';
// import '/App.css';

function Links() {
    return(
        <div className="links">
            <text><span><a target="_blank" href="https://github.com/juliancoronado">Github</a></span></text>
            <text><span><a target="_blank" href="https://linkedin.com/in/juliancoronado">LinkedIn</a></span></text>
        </div>
    );
}

export default Links;
